{"$content":[{"ID":"char_t0027_005_dialog_english##_00_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_serious","IconLocate":2,"Text":"Clues to the culprit, I do not find. If quick I am not, Karnulla will......","sfxName":"t0027_story_010","sfxVolume":0.9},{"ID":"char_t0027_005_dialog_english##_01_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_serious","IconLocate":2,"Text":"The child, how is he not here? Karnulla〜Karnulla!","sfxName":"t0027_story_016","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_02_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"Frogodile footprints!? Just one, I see not. This is what?","sfxName":"t0027_story_013","sfxVolume":0.9},{"ID":"char_t0027_005_dialog_english##_03_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"In this direction, they lead......","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_04_000","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_serious","IconLocate":2,"Text":"......I can't accept. Get out of here! I can pretend I didn't see anything.","sfxName":"b0028_story_014","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_04_001","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_anger","IconLocate":2,"Text":"Karnulla!","sfxName":"t0027_story_017","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_anger","IconLocate":2,"Text":"So it was you!","sfxName":"t0027_battle_charge_01_2_short_med","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_001","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_surprise","IconLocate":2,"Text":"No, it was them who did it. I had nothing to do with it......","sfxName":"b0028_story_016","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_002","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_anger","IconLocate":2,"Text":"Not only life, you have destroyed, but hanging with these scoundrels, you were!","sfxName":"t0027_story_012","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_003","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_surprise","IconLocate":2,"Text":"No, I wasn't! They told me to go with them, but I...","sfxName":"b0028_story_018","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_004","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_anger","IconLocate":2,"Text":"Explain nothing, you can! Wasting my efforts, you have!","sfxName":"t0027_story_003","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_005","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_serious","IconLocate":2,"Text":".........","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_006","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_anger","IconLocate":2,"Text":"In vain, my strict education has been. Think not, did I, that you——","sfxName":"t0027_story_015","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_05_007","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"——Cut the crap, old man!","sfxName":"b0028_story_015","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_000","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"When it comes down to it, you always think that I'm gonna turned bad. That's why you never really believed in me!","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_001","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"No, I......","sfxName":"t0027_battle_hit_01_1_short_normal","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_002","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"Whatever I want to do, you don't allow. I stick up for you, you yell at me! ","sfxName":"b0028_story_009","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_003","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"No matter what I do, you're never happy!","sfxName":"b0028s4_skill_s4_i1","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_004","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"Karnulla, mistaken, you are...","sfxName":"t0027_battle_hit_01_2_short_med","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_005","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"Every day, I meditate and train, and you know what? I hated it! But I still did it for you, and now you don't even believe my own words?","sfxName":"b0028_story_003","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_06_006","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"So that's how it's gonna be? Well, I won't take it anymore, Yan-Bo!","sfxName":"b0028_story_005","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_07_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"Karnulla, are you alright?","sfxName":"t0027_story_018","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_08_000","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"See? They are willing to protect me. That's what family is supposed to be!","sfxName":"b0028_battle_attack_01_1_short_normal","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_08_001","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"Concerned for you, I am. Out of love, my training and education are......","sfxName":"t0027_story_010","sfxVolume":0.8},{"ID":"char_t0027_005_dialog_english##_08_002","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"Yeah right. You're always repressing my nature. You don't care about me. You only cared about making me into what you want me to be!","sfxName":"b0028s4_skill_s4_i1","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_08_003","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"I......","sfxName":"t0027_battle_hit_02_1_short_normal","sfxVolume":0.8},{"ID":"char_t0027_005_dialog_english##_08_004","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"And they told me that you and that nasty mermaid were the ones who drove them out of their habitat. Is that true?","sfxName":"b0028_battle_charge_01_2_short_med","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_09_000","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"Not saying anything, huh? Well, then I guess the answer's obvious.","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_09_001","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"We've spent so much time together and you don't even like me. Looks like this is where we go our separate ways.","sfxName":"b0028_battle_attack_01_2_short_med","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_10_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"Karnulla. Forgive me. My fault this is!","sfxName":"t0027_story_014_ver1","sfxVolume":0.8},{"ID":"char_t0027_005_dialog_english##_10_001","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"Stop following me. Since you took care of me for three years, I'll give you some time to get outta here.","sfxName":"b0028_battle_charge_01_2_short_med","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_10_002","SpeakerName":"Karnulla","SpeakerAssetName":"CharacterName/b0028","IconName":"b0028s3_anger","IconLocate":2,"Text":"From here on out, this will be our stronghold for the strengthening of the frogodile tribe!","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_11_000","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"... And God, who lent the bud of love, 
Called back to Heaven his own; 
Death kissed it sleeping, and no more 
Its soft eyes on me shone...","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##_11_001","SpeakerName":"Yan-Bo","SpeakerAssetName":"CharacterName/t0027","IconName":"t0027s4_embarrass","IconLocate":2,"Text":"So... in fact it was I, who let you down......","sfxName":"t0027_story_010","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":"","SpeakerAssetName":"","IconName":"","IconLocate":1,"Text":"","sfxName":"","sfxVolume":1.0},{"ID":"char_t0027_005_dialog_english##","SpeakerName":